import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  header: {
    height: 60,
    backgroundColor: "orange",
    alignItems: "center",
    justifyContent: "center",
  },

  textInput: {
    width: "90%",
    marginLeft: 10,
    marginRight: 10,
    marginBottom: 30,
    borderColor: "red",
    borderBottomWidth: 2,
    fontSize: 16,
  },
});

const buttons = StyleSheet.create({
  primary: {
    elevation: 8,
    backgroundColor: "red",
    borderRadius: 10,
    paddingVertical: 20,
    paddingHorizontal: 12
  }

});

export {styles, buttons};
